import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const initialValues = {
  name: '',
  email: '',
  password: '',
  confirmPassword: ''
}

const RegisterPage = () => {
  const [values, setValues] = useState(initialValues);

  return (
    <div>
      <h1>Register</h1>
      <Link to='/login'>I already have an account</Link>
    </div>
  )
};

export default RegisterPage;
